import React, {useState} from 'react'
import {Modal, Form, Input} from 'antd'
import {GenButton} from './DashboardPage.styled'
import {GameSelect} from '../../components/SelectOptions'

interface AddTicketModalProps {
    visible: boolean
    onCancel: () => void
}

const AddTicketModal: React.FC<AddTicketModalProps> = (props) => {
    const {visible, onCancel} = props
    const [gameValue, setGameValue] = useState()

    const onFinish = (user_info) => {
        onCancel()
    }

    return (
        <Modal
            title="Add a Ticket"
            visible={visible}
            onCancel={onCancel}
            footer={[
                <GenButton style={{fontFamily: 'Mark Pro'}} key="submit" onClick={() => {}}>
                Post Ticket
                </GenButton>,
            ]}
            >
                <Form
                        hideRequiredMark={true}
                        name="basic"
                        initialValues={{ remember: true }}
                        onFinish={onFinish}
                    >
                        <Form.Item
                            label="Game"
                            name="game"
                            rules={[{ required: true, message: 'The game is required' }]}
                        >
                            <GameSelect value={gameValue} setValue={(e) => setGameValue(e)}/>
                        </Form.Item>

                        <Form.Item
                            style={{marginBottom: 0}}
                            label="Section"
                            name="section"
                            rules={[{ required: true, message: 'Price is required' }]}
                        >
                            <Input type="section" placeholder="Section #"/>
                        </Form.Item>

                        <Form.Item
                            style={{marginBottom: 0}}
                            label="Price"
                            name="price"
                            rules={[{ required: true, message: 'Price is required' }]}
                        >
                            <Input type="section" placeholder="Price"/>
                        </Form.Item>

                        <Form.Item>
                            <Row justify="center">
                                <CardButton type="primary" htmlType="submit">
                                    {title}
                                </CardButton>
                            </Row>
                        </Form.Item>
                    </Form>
        </Modal>
    )
}

export default AddTicketModal
